// State
let items = [];
let activeTag = null;
let currentModalIndex = -1;
let filteredItems = [];
let currentPage = 1;
const ITEMS_PER_PAGE = 30;

// DOM elements
const gallery = document.getElementById('gallery-grid') || document.getElementById('gallery');
const modal = document.getElementById('modal');
const modalMedia = document.getElementById('modal-media');
const modalDate = document.getElementById('modal-date');
const closeBtn = document.querySelector('.close');
const prevBtn = document.getElementById('modal-prev');
const nextBtn = document.getElementById('modal-next');
const searchInput = document.getElementById('search');
const typeFilter = document.getElementById('type-filter');
const dateFilter = document.getElementById('date-filter');
const modelFilter = document.getElementById('model-filter');
const resetBtn = document.getElementById('reset-filters');
const sortFilter = document.getElementById("sort-filter");const aspectFilter = document.getElementById("aspect-filter");
const pagination = document.getElementById('pagination');

// URL History management
function updateURL(item) {
    if (item) {
        const url = new URL(window.location);
        url.searchParams.set('view', item.id);
        window.history.pushState({ itemId: item.id }, '', url);
    } else {
        const url = new URL(window.location);
        url.searchParams.delete('view');
        window.history.pushState({}, '', url);
    }
}

// Handle browser back/forward
window.addEventListener('popstate', (e) => {
    const url = new URL(window.location);
    const viewId = url.searchParams.get('view');

    if (viewId) {
        const item = items.find(i => i.id === viewId);
        if (item) {
            const index = filteredItems.indexOf(item);
            if (index !== -1) {
                openModal(item, index, false); // false = don't push to history
            }
        }
    } else {
        closeModal(false); // false = don't push to history
    }
});

// Check URL on load
function checkURLOnLoad() {
    const url = new URL(window.location);
    const viewId = url.searchParams.get('view');

    if (viewId) {
        const item = items.find(i => i.id === viewId);
        if (item) {
            const index = filteredItems.indexOf(item);
            if (index !== -1) {
                openModal(item, index, false);
            }
        }
    }
}

// Load data - try fetch first (for served files), fall back to embedded (for file://)
async function loadData() {
    try {
        const response = await fetch('data/gallery.json');
        if (response.ok) {
            const data = await response.json();
            items = data.items;
        } else {
            throw new Error('Fetch failed');
        }
    } catch (error) {
        // Fall back to embedded data for local file:// access
        console.log('Using embedded data (local mode)');
        items = embeddedData.items;
    }
    // Sort by date descending (newest first)
    items.sort((a, b) => new Date(b.created) - new Date(a.created));

    // Populate date filter with available years
    populateDateFilter();

    // Populate model filter with available models
    populateModelFilter();

    renderGallery();
    checkURLOnLoad();
}

// Populate date filter dropdown
function populateDateFilter() {
    const years = new Set();
    items.forEach(item => {
        const year = item.created.substring(0, 4);
        years.add(year);
    });

    const sortedYears = Array.from(years).sort((a, b) => b - a);

    dateFilter.innerHTML = '<option value="">All Time</option>';
    sortedYears.forEach(year => {
        dateFilter.innerHTML += `<option value="${year}">${year}</option>`;
    });
}

// Populate model filter dropdown
function populateModelFilter() {
    const models = new Set();
    items.forEach(item => {
        if (item.model) {
            models.add(item.model);
        }
    });

    const sortedModels = Array.from(models).sort();

    modelFilter.innerHTML = '<option value="">All Models</option>';
    sortedModels.forEach(model => {
        modelFilter.innerHTML += `<option value="${model}">${model}</option>`;
    });
}

// Filter items
function getFilteredItems() {
    const searchTerm = searchInput.value.toLowerCase().trim();
    const typeValue = typeFilter.value;
    const dateValue = dateFilter.value;
    const modelValue = modelFilter.value;

    return items.filter(item => {
        // Type filter
        if (typeValue !== 'all' && item.type !== typeValue) return false;

        // Tag filter
        if (activeTag && !item.tags.includes(activeTag)) return false;

        // Date filter (by year)
        if (dateValue) {
            const itemYear = item.created.substring(0, 4);
            if (itemYear !== dateValue) return false;
        }

        // Model filter
        if (modelValue && item.model !== modelValue) return false;

        // Keyword search (searches name, prompt, tags, and model)
        if (searchTerm) {
            const searchable = [
                item.name,
                item.prompt,
                item.model || '',
                ...item.tags
            ].join(' ').toLowerCase();
            if (!searchable.includes(searchTerm)) return false;
        }

        return true;
    });
}

// Get paginated items
function getPaginatedItems() {
    const startIndex = (currentPage - 1) * ITEMS_PER_PAGE;
    const endIndex = startIndex + ITEMS_PER_PAGE;
    return filteredItems.slice(startIndex, endIndex);
}

// Get total pages
function getTotalPages() {
    return Math.ceil(filteredItems.length / ITEMS_PER_PAGE);
}

// Render pagination
function renderPagination() {
    const totalPages = getTotalPages();

    if (totalPages <= 1) {
        pagination.innerHTML = '';
        return;
    }

    let html = '';

    // Previous button
    html += `<button ${currentPage === 1 ? 'disabled' : ''} data-page="${currentPage - 1}">Previous</button>`;

    // Page numbers - show max 5 pages around current
    const maxVisible = 5;
    let startPage = Math.max(1, currentPage - Math.floor(maxVisible / 2));
    let endPage = Math.min(totalPages, startPage + maxVisible - 1);

    if (endPage - startPage < maxVisible - 1) {
        startPage = Math.max(1, endPage - maxVisible + 1);
    }

    if (startPage > 1) {
        html += `<button data-page="1">1</button>`;
        if (startPage > 2) html += `<span class="pagination-info">...</span>`;
    }

    for (let i = startPage; i <= endPage; i++) {
        html += `<button class="${i === currentPage ? 'active' : ''}" data-page="${i}">${i}</button>`;
    }

    if (endPage < totalPages) {
        if (endPage < totalPages - 1) html += `<span class="pagination-info">...</span>`;
        html += `<button data-page="${totalPages}">${totalPages}</button>`;
    }

    // Next button
    html += `<button ${currentPage === totalPages ? 'disabled' : ''} data-page="${currentPage + 1}">Next</button>`;

    pagination.innerHTML = html;

    // Add click handlers
    pagination.querySelectorAll('button').forEach(btn => {
        btn.addEventListener('click', () => {
            const page = parseInt(btn.dataset.page);
            if (page && page !== currentPage) {
                currentPage = page;
                renderGallery();
                window.scrollTo({ top: 0, behavior: 'smooth' });
            }
        });
    });
}

// Render gallery
function renderGallery() {
    filteredItems = getFilteredItems();
    const paginatedItems = getPaginatedItems();

    if (filteredItems.length === 0) {
        gallery.innerHTML = '<div class="empty-state"><h3>No results found</h3><p>Try adjusting your search or filters</p></div>';
        pagination.innerHTML = '';
        return;
    }

    // Calculate the starting index for the current page
    const pageStartIndex = (currentPage - 1) * ITEMS_PER_PAGE;

    gallery.innerHTML = paginatedItems.map((item, localIndex) => {
        const index = pageStartIndex + localIndex;
        let mediaHtml = '';
        let badgeHtml = '';
        let overlayHtml = '';

        if (item.type === 'video') {
            // For videos, use thumbnail_url if provided, otherwise show placeholder
            if (item.thumbnail_url) {
                mediaHtml = `<img src="${item.thumbnail_url}" alt="" loading="lazy">`;
            } else {
                // Video placeholder with play icon
                mediaHtml = '<div class="video-placeholder"></div>';
            }
            badgeHtml = '<div class="video-play-icon"></div>';
        } else if (item.type === 'music') {
            // For music, use thumbnail_url if available, otherwise placeholder
            if (item.thumbnail_url) {
                mediaHtml = `<img src="${item.thumbnail_url}" alt="" loading="lazy">`;
            } else {
                mediaHtml = '<div class="music-placeholder">&#127925;</div>';
            }
            badgeHtml = '<span class="type-badge music">music</span>';
        } else {
            mediaHtml = `<img src="${item.cdn_url}" alt="" loading="lazy">`;
        }

        overlayHtml = `
            <div class="overlay">
                <div class="title">${item.name}</div>
            </div>
        `;

        return `
        <div class="gallery-item" data-id="${item.id}" data-index="${index}">
            ${badgeHtml}
            ${mediaHtml}
            ${overlayHtml}
        </div>
    `}).join('');

    // Add click handlers
    gallery.querySelectorAll('.gallery-item').forEach(el => {
        el.addEventListener('click', () => {
            const index = parseInt(el.dataset.index);
            openModal(filteredItems[index], index);
        });
    });

    // Render pagination
    renderPagination();
}

// Open modal
function openModal(item, index, pushHistory = true) {
    currentModalIndex = index;

    // Update URL for back button support
    if (pushHistory) {
        updateURL(item);
    }

    // Set media
    if (item.type === 'video') {
        // Check if CDN URL is accessible - show message if not
        modalMedia.innerHTML = `
            <video src="${item.cdn_url}" controls autoplay loop playsinline
                onerror="this.outerHTML='<div class=\\'video-error\\'>Video unavailable. <a href=\\'${item.url}\\' target=\\'_blank\\'>View on Midjourney</a></div>'">
                Your browser does not support video playback.
            </video>`;
    } else if (item.type === 'music') {
        // For Suno music with video, show video player
        if (item.cdn_url && item.cdn_url.endsWith('.mp4')) {
            modalMedia.innerHTML = `<video src="${item.cdn_url}" controls autoplay loop playsinline>
                Your browser does not support video playback.
            </video>`;
        } else {
            modalMedia.innerHTML = `<audio src="${item.cdn_url}" controls autoplay></audio>`;
        }
    } else {
        modalMedia.innerHTML = `<img src="${item.cdn_url}" alt="">`;
    }
    if (modalDate) modalDate.textContent = item.created || '';

    // Update navigation buttons
    updateNavButtons();

    modal.classList.add('active');
    document.body.style.overflow = 'hidden';
}

// Filter by tag (called from modal tag click)
function filterByTag(tag) {
    // Set the active tag
    activeTag = tag;
    currentPage = 1;

    // Re-render gallery with filter
    renderGallery();

    // Scroll to top of gallery
    window.scrollTo({ top: 0, behavior: 'smooth' });
}

// Update navigation button states
function updateNavButtons() {
    prevBtn.disabled = currentModalIndex <= 0;
    nextBtn.disabled = currentModalIndex >= filteredItems.length - 1;
}

// Navigate to previous item
function showPrevious() {
    if (currentModalIndex > 0) {
        currentModalIndex--;
        openModal(filteredItems[currentModalIndex], currentModalIndex);
    }
}

// Navigate to next item
function showNext() {
    if (currentModalIndex < filteredItems.length - 1) {
        currentModalIndex++;
        openModal(filteredItems[currentModalIndex], currentModalIndex);
    }
}

// Close modal
function closeModal(pushHistory = true) {
    modal.classList.remove('active');
    document.body.style.overflow = '';
    modalMedia.innerHTML = '';

    if (pushHistory) {
        updateURL(null);
    }
}

// Event listeners - guard for pages where modal elements may not exist
if (closeBtn) closeBtn.addEventListener('click', () => closeModal());
if (prevBtn) prevBtn.addEventListener('click', showPrevious);
if (nextBtn) nextBtn.addEventListener('click', showNext);

if (modal) modal.addEventListener('click', (e) => {
    if (e.target === modal) closeModal();
});

// Keyboard navigation
document.addEventListener('keydown', (e) => {
    if (!modal || !modal.classList.contains('active')) return;

    if (e.key === 'Escape') closeModal();
    if (e.key === 'ArrowLeft') showPrevious();
    if (e.key === 'ArrowRight') showNext();
});

// Mouse wheel navigation in modal - with cursor position detection and scroll threshold
let scrollAccumulator = 0;
const SCROLL_THRESHOLD = 300; // Increased for more subtle transitions // Pixels of scroll before changing image (prevents too-fast scrolling)

if (modal) modal.addEventListener('wheel', (e) => {
    if (!modal.classList.contains('active')) return;

    // Check if cursor is over the image area or the metadata area
    const mediaWrapper = document.querySelector('.modal-media-wrapper');
    if (!mediaWrapper) return;

    const rect = mediaWrapper.getBoundingClientRect();
    const isOverImage = (
        e.clientX >= rect.left && e.clientX <= rect.right &&
        e.clientY >= rect.top && e.clientY <= rect.bottom
    );

    if (isOverImage) {
        // Cursor over image: use scroll to change images (with threshold)
        e.preventDefault();
        scrollAccumulator += e.deltaY;

        if (scrollAccumulator > SCROLL_THRESHOLD) {
            showNext();
            scrollAccumulator = 0;
        } else if (scrollAccumulator < -SCROLL_THRESHOLD) {
            showPrevious();
            scrollAccumulator = 0;
        }
    }
    // Cursor over metadata area: let normal scroll happen (don't preventDefault)
    // This allows users to scroll down to see prompt and parameters
}, { passive: false });

// Only set up gallery controls if gallery grid exists on this page
if (gallery) {
    // Search and filter listeners with debounce
    let searchTimeout;
    if (searchInput) searchInput.addEventListener('input', () => {
        clearTimeout(searchTimeout);
        searchTimeout = setTimeout(() => {
            currentPage = 1;
            renderGallery();
        }, 200);
    });

    if (typeFilter) typeFilter.addEventListener('change', () => {
        currentPage = 1;
        renderGallery();
    });

    if (dateFilter) dateFilter.addEventListener('change', () => {
        currentPage = 1;
        renderGallery();
    });

    if (modelFilter) modelFilter.addEventListener('change', () => {
        currentPage = 1;
        renderGallery();
    });

    if (sortFilter) sortFilter.addEventListener("change", () => { currentPage = 1; renderGallery(); });
    if (aspectFilter) aspectFilter.addEventListener("change", () => { currentPage = 1; renderGallery(); });

    // Reset all filters
    if (resetBtn) resetBtn.addEventListener('click', () => {
        if (searchInput) searchInput.value = '';
        if (typeFilter) typeFilter.value = 'all';
        if (dateFilter) dateFilter.value = '';
        if (modelFilter) modelFilter.value = "";
        if (sortFilter) sortFilter.value = "newest";
        if (aspectFilter) aspectFilter.value = "";
        activeTag = null;
        currentPage = 1;
        renderGallery();
    });

    // Initialize
    loadData();
}
